      case 653: /* hint_list ::= */
{ yymsp[1].minor.yy34 = createHintNodeList(pCxt, NULL); }
        break;
      case 654: /* hint_list ::= NK_HINT */
{ yylhsminor.yy34 = createHintNodeList(pCxt, &yymsp[0].minor.yy0); }
