{ yymsp[0].minor.yy548 = ORDER_DESC; }
        break;
      case 738: /* null_ordering_opt ::= */
{ yymsp[1].minor.yy817 = NULL_ORDER_DEFAULT; }
        break;
      case 739: /* null_ordering_opt ::= NULLS FIRST */
{ yymsp[-1].minor.yy817 = NULL_ORDER_FIRST; }
        break;
